import React, { useEffect, useState, useCallback } from 'react';
import { GoogleMap, LoadScript, Marker, InfoWindow } from '@react-google-maps/api';
import { useParams, Link } from 'react-router-dom';
import { AlertCircle, MapPin } from 'lucide-react';
import { Alert, AlertDescription, AlertTitle } from "@/components/ui/alert";
import { Button } from "@/components/ui/button";
import CoordenadasService from '../services/CoordenadasService';

const estiloContenedorMapa = {
  height: '400px',
  width: '100%',
};

const centroPredeterminado = { lat: 4.570868, lng: -74.297333 }; // Centro predeterminado de Colombia

function MapaIndividual() {
  const { idpersona } = useParams();
  const [marcador, setMarcador] = useState(null);
  const [marcadorSeleccionado, setMarcadorSeleccionado] = useState(null);
  const [error, setError] = useState(null);
  const [cargando, setCargando] = useState(true);

  const obtenerCoordenadas = useCallback(async () => {
    try {
      setCargando(true);
      const coordenadas = await CoordenadasService.getCoordenadasIndividual(idpersona);
      
      if (!coordenadas || 
          isNaN(parseFloat(coordenadas.latitud)) || 
          isNaN(parseFloat(coordenadas.longitud)) ||
          parseFloat(coordenadas.latitud) < -90 || 
          parseFloat(coordenadas.latitud) > 90 ||
          parseFloat(coordenadas.longitud) < -180 || 
          parseFloat(coordenadas.longitud) > 180) {
        throw new Error('Se recibieron coordenadas inválidas');
      }

      const lat = parseFloat(coordenadas.latitud);
      const lng = parseFloat(coordenadas.longitud);

      setMarcador({
        id: coordenadas.id,
        marca: coordenadas.marca,
        lat: lat,
        lng: lng,
      });
      setError(null);
    } catch (error) {
      console.error('Error al obtener coordenadas:', error);
      setError(error.message || 'Error al obtener las coordenadas');
    } finally {
      setCargando(false);
    }
  }, [idpersona]);

  useEffect(() => {
    obtenerCoordenadas();
  }, [obtenerCoordenadas]);

  const manejarClicMarcador = (marcador) => {
    setMarcadorSeleccionado(marcador);
  };

  const manejarCierreVentanaInfo = () => {
    setMarcadorSeleccionado(null);
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gradient-to-b from-primary to-secondary p-4">
      <div className="w-full max-w-3xl bg-background rounded-lg shadow-lg p-6">
        <h1 className="text-2xl font-bold mb-4 text-foreground">Mapa Individual</h1>
        
        {error && (
          <Alert variant="destructive" className="mb-4">
            <AlertCircle className="h-4 w-4" />
            <AlertTitle>Error</AlertTitle>
            <AlertDescription>{error}</AlertDescription>
          </Alert>
        )}
        
        {cargando ? (
          <div className="flex justify-center items-center h-[400px]">
            <div className="animate-spin rounded-full h-32 w-32 border-t-2 border-b-2 border-primary"></div>
          </div>
        ) : (
          <LoadScript googleMapsApiKey="TU_CLAVE_API_DE_GOOGLE_MAPS">
            <GoogleMap
              mapContainerStyle={estiloContenedorMapa}
              center={marcador ? { lat: marcador.lat, lng: marcador.lng } : centroPredeterminado}
              zoom={marcador ? 12 : 5}
            >
              {marcador && (
                <Marker
                  key={marcador.id}
                  position={{ lat: marcador.lat, lng: marcador.lng }}
                  title={marcador.marca}
                  onClick={() => manejarClicMarcador(marcador)}
                  icon={{
                    path: MapPin,
                    fillColor: '#ff0000',
                    fillOpacity: 1,
                    strokeWeight: 0,
                    scale: 1.5
                  }}
                />
              )}

              {marcadorSeleccionado && (
                <InfoWindow
                  position={{ lat: marcadorSeleccionado.lat, lng: marcadorSeleccionado.lng }}
                  onCloseClick={manejarCierreVentanaInfo}
                >
                  <div>
                    <h3 className="font-bold">{marcadorSeleccionado.marca}</h3>
                    <p>ID: {marcadorSeleccionado.id}</p>
                    <p>Latitud: {marcadorSeleccionado.lat.toFixed(6)}</p>
                    <p>Longitud: {marcadorSeleccionado.lng.toFixed(6)}</p>
                  </div>
                </InfoWindow>
              )}
            </GoogleMap>
          </LoadScript>
        )}

        <div className="mt-4 flex justify-center">
          <Button asChild>
            <Link to="/home">Volver al Inicio</Link>
          </Button>
        </div>
      </div>
    </div>
  );
}

export default MapaIndividual;
